Dzień dobrym, mam do sprzedania samochód osobowy marki Chrysler Voyager LX wyprodukowany w 2002 roku, który został wyposażony w silnik benzynowy, doposażony w instalacje LPG (brak papieru od butli) o pojemności 3301 cm3, legitymujący się mocą 174 KM, który pokonał do tej pory 305000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Chrysler prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji, uszkodzony jest prawy błotnik i dwie pary drzwi, slupki i progi całe. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane, komfortu dodaje sprawna i chłodząca klimatyzacja.



Voyager jest wyposażenia w:

- Klimatyzacja;

- Elektryczne szyby przednie;

- Elektrycznie regulowane i podgrzewane lusterka;

- ABS z ESP;

- Centralny zamek;

- 2 x airbag;

- Radio DVD, CD, z kolorowym wyswietlaczem Panasonic;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 15.06.2026 roku.

Przegląd techniczny 02.07.2026 roku.

